    const eachWork = (workList) => {
        return workList.map(eachItem => {
            return (  
            <div className="test">
                {eachItem.title}
            </div>
                )
        })
    }
    return (
        <div className="ExperiencePage">
            {eachWork(mainWorkList)}
        </div>
    )
}

